   *
   * @alias max
   *
   * @desc Get the item with the highest priority
   *
   * @returns {Item} highest priority item
   */
  get high(): Item {
    return this.max;
  }

  /**
   * @public
   *
   * @desc Get the item with the lowest priority
   *
   * @returns {Item} lowest priority item
   */
  get min(): Item {
    return this._queue[this._queue.length - 1];
  }

  /**
   * @public
   *
   * @alias min
   *
   * @desc Get the item with the lowest priority
   *
   * @returns {Item} lowest priority item
   */
  get low(): Item {
    return this.min;
  }

  /**
